INSERT INTO `tbl_pages` (`id`, `menu_id`, `name`, `subject`, `url`, `synopsis`, `text`, `media`, `attribute`, `publish_date`, `unpublish_date`, `allow_comment`, `tags`, `order`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(1, 1, '', 'Kewpie is now present in Indonesia!', 'kewpie-is-now-present-in-indonesia', '<p>\n	Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean at faucibus enim. Sed vel tempor elit, nec eleifend justo. Nullam varius a tortor quis imperdiet. Vivamus ac faucibus nulla. Vestibulum gravida ultricies magna,</p>\n', '<p>\n	Kewpie is now present in Indonesia. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\n', NULL, NULL, '2015-02-13', '2015-02-28', 1, NULL, NULL, NULL, NULL, 'publish', NULL, 1432744153),
(8, 2, NULL, 'Mayonnaise', 'mayonnaise', '<p>\n	mayonnaise</p>\n', '<p>\n	mayonnaise text</p>\n', 'c3160-mayonais.png', NULL, '2015-05-27', '2015-05-27', NULL, NULL, NULL, NULL, NULL, 'publish', 1432716809, 1432717128),
(9, 2, NULL, 'Oyster Sauce', 'oyster-sauce', '<p>\n	Oyster Sauce</p>\n', '<p>\n	Oyster Sauce</p>\n', '9b83b-saus-tiram.png', NULL, '2015-05-27', '2015-05-27', NULL, NULL, NULL, NULL, NULL, 'publish', 1432717200, NULL),
(10, 2, NULL, 'Sandwich spread', 'sandwich-spread', '<p>\n	Sandwich spread</p>\n', '<p>\n	Sandwich spread</p>\n', '8936e-olesan-sandwich.png', NULL, '2015-05-27', '2015-05-27', NULL, NULL, NULL, NULL, NULL, 'publish', 1432717246, NULL),
(11, 2, NULL, 'Sweet sauce', 'sweet-sauce', '<p>\n	Sweet sauce</p>\n', '<p>\n	Sweet sauce</p>\n', '9263e-saus-manis.png', NULL, '2015-05-27', '2015-05-27', NULL, NULL, NULL, NULL, NULL, 'publish', 1432717281, NULL),
(12, 3, NULL, 'KEWPIE Mayonnaise Origins', 'kewpie-mayonnaise-origins', '<p>\n	KEWPIE Mayonnaise Origins<br />\n	<br />\n	Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old.</p>\n', '<p>\n	Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot; (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, &quot;Lorem ipsum dolor sit amet..&quot;, comes from a line in section 1.10.32.<br />\n	<br />\n	The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from &quot;de Finibus Bonorum et Malorum&quot; by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432767310, 1432786988),
(14, 3, NULL, 'Packaging & Storage', 'packaging-storage', '<p>\n	Packaging &amp; Storage</p>\n', '<p>\n	Packaging &amp; Storage</p>\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432789056, NULL),
(13, 3, NULL, 'What’s In Our Mayonnaise', 'whats-in-our-mayonnaise', '<p>\n	What&rsquo;s In Our Mayonnaise</p>\n', 'What’s In Our Mayonnaise\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432767782, 1432787291);
