INSERT INTO `tbl_page_menus` (`id`, `parent_id`, `type`, `name`, `subject`, `text`, `url`, `media`, `position`, `sub_level`, `order`, `is_system`, `has_child`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(2, NULL, 'product', NULL, 'Our Product', '<p>\n	Products PT. Kewpie INDONESIA obtain Halal certification and NKV, and begin product sales for Food Service.</p>\n', 'our-product', '59770-3_cottage_lane_s2_by_vinzdelacalzada.jpg', 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', NULL, 1432757330),
(3, NULL, 'page', NULL, 'Inside KEWPIE', '<h2>\n	KEWPIE Indonesia</h2>\n<p>\n	<br />\n	PT. Kewpie INDONESIA established in 2013 and started the first sales specialized Food Service in October 2014. With the halal certificate and NKV, Kewpie Indonesia providing halal food products, safe and quality for the people of Indonesia.</p>\n<h2>\n	<br />\n	Company Timeline</h2>\n<p>\n	<strong>1919</strong><br />\n	<br />\n	Shokuhin Kogyo Co., Ltd., the beginning of what is now called Kewpie Corporation stands at Otaki-cho, Nakano-ku, Tokyo and started producing and processing a wide range of food products.<br />\n	<br />\n	<strong>1925</strong><br />\n	<br />\n	Kewpie Mayonnaise sales began. Kewpie mayonnaise sold in a glass jar packaging weighing 100 grams and 128 grams, and is mayonaiss in the first jar packaging in Japan.<br />\n	<br />\n	<strong>1957</strong><br />\n	<br />\n	Company renamed Kewpie Corporation, in accordance with mayonnaise brand names that are well known.<br />\n	<br />\n	<strong>2013</strong><br />\n	<br />\n	PT. Kewpie INDONESIA stand.<br />\n	<br />\n	<strong>2014</strong><br />\n	<br />\n	Products PT. Kewpie INDONESIA obtain Halal certification and NKV, and begin product sales for Food Service.<br />\n	<br />\n	<strong>2015</strong><br />\n	<br />\n	Sales of retail products PT. Kewpie INDONESIA begins.</p>\n<h2>\n	Halal certification and NKV</h2>\n<p>\n	All products are certified kosher Kewpie Indonesia officially issued by MUI LPPOM. The products are made from egg has officially NKV.</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n', 'inside-kewpie', 'a7df1-smpl-rsp-1.png', 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', NULL, 1432757341),
(4, NULL, 'recipe', NULL, 'Recipes', '<p>\n	Recipes Page Menu Description</p>\n', 'recipes', NULL, 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432635063, 1432757350),
(5, NULL, 'page', NULL, 'Who are we', '<p>\n	Who are we description</p>\n', 'who-are-we', NULL, 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432635116, 1432757359),
(6, NULL, 'news', NULL, 'Latest News', '<p>\n	Latest News menu description</p>\n', 'latest-news', NULL, 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432635133, 1432757369),
(1, NULL, NULL, NULL, 'Home', '<p>\n	Home Page Description</p>\n', 'home', NULL, 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', NULL, 1432711581);
