(1, 'tbl_pages', 1, 1, NULL, 'Kewpie sekarang hadir di indonesia', 'kewpie-sekarang-hadir-di-indonesia', '<p>\n	Kewpie sekarang hadir di indonesia</p>\n', '<p>\n	Kewpie sekarang hadir di indonesia. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\n', 1, NULL, 0, 1432742665, 1432744175),
(2, 'tbl_pages', 8, 1, NULL, 'Mayonais', 'mayonais', '<p>\n	Mayonais</p>\n', '<p>\n	Mayonais</p>\n', 1, NULL, 0, 1432742735, 1432742819),
(5, 'tbl_page_menus', 2, 1, NULL, 'Produk Kami', 'produk-kami', NULL, '<p>\n	Produk PT. Kewpie INDONESIA mendapatkan sertifikasi Halal dan NKV, dan mulai penjualan produk Food Service.</p>\n', 1, NULL, 1, 1432743088, 1432751501),
(6, 'tbl_page_menus', 3, 1, NULL, 'Di dalam KEWPIE', 'di-dalam-kewpie', NULL, '<h2>\n	KEWPIE Indonesia</h2>\n<p>\n	<br />\n	PT. KEWPIE INDONESIA berdiri pada tahun 2013 dan memulai penjualan pertama khusus Food Service pada bulan Oktober 2014 . Dengan sertifikat halal dan NKV, Kewpie Indonesia menyediakan produk makanan halal, aman serta berkualitas untuk masyarakat Indonesia.<br />\n	&nbsp;</p>\n<h2>\n	Sejarah Perusahaan</h2>\n<p>\n	<br />\n	<strong>1919</strong><br />\n	<br />\n	Shokuhin Kogyo Co., Ltd, perusahaan awal yang sekarang disebut KEWPIE Corporation berdiri di Otaki-cho, Nakano-ku, Tokyo dan mulai memproduksi serta mengolah berbagai macam produk makanan.<br />\n	<br />\n	<strong>1925</strong><br />\n	<br />\n	Penjualan KEWPIE Mayonnaise dimulai. Mayonais Kewpie dijual dalam kemasan toples kaca dengan berat 100 gram dan 128 gram, serta merupakan mayonaiss dalam kemasan toples pertama di Jepang.<br />\n	<br />\n	<strong>1957</strong><br />\n	<br />\n	Perusahaan berganti nama menjadi KEWPIE Corporation, sesuai dengan nama merek mayonais yang sudah terkenal.<br />\n	<br />\n	<strong>2013</strong><br />\n	<br />\n	PT. KEWPIE INDONESIA berdiri.<br />\n	<br />\n	<strong>2014</strong><br />\n	<br />\n	Produk-produk PT. KEWPIE INDONESIA mendapatkan sertifikasi Halal dan NKV, serta memulai penjualan untuk produk Food Service.<br />\n	<br />\n	<strong>2015</strong><br />\n	<br />\n	Penjualan produk retail PT. KEWPIE INDONESIA dimulai.<br />\n	&nbsp;</p>\n<h2>\n	Sertifikasi Halal dan NKV</h2>\n<p>\n	Seluruh produk Kewpie Indonesia bersertifikat halal resmi yang dikeluarkan oleh LPPOM MUI. Produk-produk yang berbahan dasar telur telah memiliki NKV resmi.</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n', 1, NULL, 1, 1432743463, 1432754614),
