(22, 'tbl_product_categories', 4, 1, NULL, 'Layanan Makanan', 'layanan-makanan', NULL, '<p>\n	Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean at faucibus enim. Sed vel tempor elit, nec eleifend justo. Nullam varius a tortor quis imperdiet. Vivamus ac faucibus nulla. Vestibulum gravida ultricies magna,</p>\n', 1, NULL, 1, 1432745449, 1432789914),
(23, 'tbl_pages', 12, 1, NULL, 'KEWPIE Mayonnaise Origins', 'kewpie-mayonnaise-origins', '<p>\n	Berlawanan dengan kepercayaan populer, Lorem Ipsum bukan hanya teks acak. Ini memiliki akar dalam naskah sastra latin klasik dari 45 SM, sehingga lebih tua dari 2000 tahun. Richard McClintock, seorang profesor Latin di Hampden-Sydney College di Virginia, mendongak salah satu kata latin yang lebih jelas, yakni consectetur, dari bagian Lorem Ipsum, dan akan melalui mengutip dari kata dalam literatur klasik, sumber yang tidak bisa diragukan.</p>\n', '<p>\n	Berlawanan dengan kepercayaan populer, Lorem Ipsum bukan hanya teks acak. Ini memiliki akar dalam naskah sastra latin klasik dari 45 SM, sehingga lebih tua dari 2000 tahun. Richard McClintock, seorang profesor Latin di Hampden-Sydney College di Virginia, mendongak salah satu kata latin yang lebih jelas, yakni consectetur, dari bagian Lorem Ipsum, dan akan melalui mengutip dari kata dalam literatur klasik, sumber yang tidak bisa diragukan. Lorem Ipsum berasal dari bagian 1.10.32 dan 1.10.33 dari &quot;de Finibus Bonorum et Malorum&quot; (Sisi Ekstrim dari Kebaikan dan Kejahatan) oleh Cicero, yang ditulis pada 45 SM. Buku ini adalah sebuah risalah pada teori etika, sangat populer selama Renaissance. Baris pertama dari Lorem Ipsum, &quot;Lorem ipsum dolor sit amet ..&quot;, berasal dari garis pada bagian 1.10.32.<br />\n	<br />\n	Bagian standar dari Lorem Ipsum yang digunakan sejak tahun 1500-an direproduksi di bawah ini untuk mereka yang tertarik. Bagian 1.10.32 dan 1.10.33 dari &quot;de Finibus Bonorum et Malorum&quot; oleh Cicero juga direproduksi dalam bentuk aslinya yang tepat mereka, disertai dengan versi bahasa Inggris dari 1914 terjemahan oleh H. Rackham.</p>\n', 1, NULL, 0, 1432767369, 1432787251),
